css:
@-moz-document domain(catlikecoding.com) {
  body {
      background-color: #2f2f2f;
      color: #cbcbcb;
  }
  article {
      background-color: #1d1d1d;
  }
  article pre {
      background-color: #171717;
  }
  article .keyword {
      color: #229bdd;
  }
  article .cc-type,
  article .unity-type,
  article .msdn-type,
  article .type {
      color: #6aa56a !important;
  }
  article mark,
  article ins {
      background-color: #464647;
  }
  article .constant {
      color: #3ac9da;
  }
  article .unity-method {
      color: #545454 !important;
  }
  article aside {
      background-color: #2f2f2f;
      border: 2px solid #6e6e6e;
  }

  .tutorial-summary {
      background-color: #2f2f2f;
  }
}
